import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import NavigationMenu from "./NavigationMenu";
import SearchBar from "./search-bar/SearchBar";

const App = () => {
  return (
    <>
      <NavigationMenu />
      <div className="my-5">
      <SearchBar/>
      </div>

      <div>'Movies'</div>
    </>
  );
};
export default App;
